import React from "react";
import OneOfPostPresenter from "./OneOfPostPresenter";
import { withRouter } from "react-router-dom";

export default withRouter(
  ({
    match: {
      params: { id }
    }
  }) => {
    return <OneOfPostPresenter id={id} />;
  }
);
